package com.yunkakeji.baidudemo.modules.ocr;

import com.blankj.utilcode.util.ToastUtils;
import com.yunkakeji.baidudemo.R;
import com.yunkakeji.baidudemo.base.activity.BaseActivity;
import com.yunkakeji.baidudemo.databinding.ActivityIdCardBinding;
import com.yunkakeji.baidudemo.net.dataModel.ocr.ORCViewModel;

import java.io.IOException;

import androidx.databinding.DataBindingUtil;
import androidx.lifecycle.Observer;
import androidx.lifecycle.ViewModelProviders;
import okhttp3.ResponseBody;

/**
 * Created by Administrator
 * on 2020/1/6 17:37
 * 身份证识别
 */
public class IDCardActivity extends BaseActivity {

    private ActivityIdCardBinding mBD;

    private ORCViewModel orcViewModel = null;


    private String accessToken = null;

    //身份证图片base64编码字符串
    private String idCardImageBase64 = "";


    @Override
    protected void initView() {
        mBD = DataBindingUtil.setContentView(this, R.layout.activity_id_card);
        orcViewModel = ViewModelProviders.of(this).get(ORCViewModel.class);

        accessToken=getIntent().getStringExtra("Token");
    }

    @Override
    protected void initData() {

        orcViewModel.getIdCardInfo().observe(this, new Observer<ResponseBody>() {
            @Override
            public void onChanged(ResponseBody responseBody) {
                dismiss();
                if (responseBody==null){
                    ToastUtils.showShort("请求失败！");
                    return;
                }
                try {
                    mBD.tvContent.setText(responseBody.string());
                } catch (IOException e) {
                    e.printStackTrace();
                }
            }
        });

        getIDCardInfo();
    }

    private void getIDCardInfo() {

        show("正在请求");
        orcViewModel.postIdCardInfo(accessToken,idCardImageBase64,"front");
    }
}
